{"triggers":[
  {
    "rule": {
      "id": "nfd-000-006",
      "name": "Detect failed attempt to fetch sensitive files",
      "tags": {
        "category": "attack_attempt",
        "confidence": "1",
        "type": "security_scanner"
      }
    },
    "rule_matches": [
      {
        "operator": "match_regex",
        "operator_value": "^404$",
        "parameters": [
          {
            "address": "server.response.status",
            "highlight": [
              "404"
            ],
            "key_path": [],
            "value": "404"
          }
        ]
      },
      {
        "operator": "match_regex",
        "operator_value": "\\.(cgi|bat|dll|exe|key|cert|crt|pem|der|pkcs|pkcs|pkcs[0-9]*|nsf|jsa|war|java|class|vb|vba|so|git|svn|hg|cvs)([^a-zA-Z0-9_]|$)",
        "parameters": [
          {
            "address": "server.request.uri.raw",
            "highlight": [
              ".git"
            ],
            "key_path": [],
            "value": "/.git"
          }
        ]
      }
    ]
  }
]}
